pragma solidity ^0.4.0;

import "./owned.sol";
import "./mortal.sol";
import "./timeStamped.sol";
import "./Amendment.sol";
import "./Assignment.sol";
import "./UsageDocument.sol";

/**
 * Base documenation and timeline of a Common Law Trademark on the blockchain
 *
 * Explore an interface for listing, getOwnership() or getAssignment() could point to
 * and address of blockchain account in the future
 */
contract Listing is owned, timeStamped, mortal {

    string private mark;

    Assignment private assignment;
    UsageDocument private usageDocument;
    Amendment private amendment;

    // Events
    event Deleted(string _mark, address _listing);

    function Listing(string _mark) {
        mark = _mark;
    }

    function appendAssignment(Assignment _assignment) public restricted returns (Assignment) {
        if(assignment == address(0)) {
            assignment = _assignment;
            return assignment;
        }

        return Assignment(assignment.append(_assignment));
    }

    function appendUsageDocument(UsageDocument _usageDocument) public restricted returns (UsageDocument) {
        if(usageDocument == address(0)) {
            usageDocument = _usageDocument;
            return usageDocument;
        }

        return UsageDocument(usageDocument.append(_usageDocument));
    }

    function appendAmendment(Amendment _amendment) public restricted returns (Amendment) {
        if(amendment == address(0)) {
            amendment = _amendment;
            return amendment;
        }

        return Amendment(amendment.append(_amendment));
    }

    // Restricted getters
    //-------------------

    function getMark() external constant restricted returns (string) {
        return mark;
    }
    function getAssignment() external constant restricted returns (Assignment) {
        return assignment;
    }
    function getUsageDocument() external constant restricted returns (UsageDocument) {
        return usageDocument;
    }
    function getAmendment() external constant restricted returns (Amendment) {
        return amendment;
    }


    // Removal
    //--------

    function cleanup() external restricted {
        if(assignment != address(0)) {
            assignment.cleanup();
        }
        if(usageDocument != address(0)) {
            usageDocument.cleanup();
        }
        if(amendment != address(0)) {
            amendment.cleanup();
        }

        this.kill();

        Deleted(mark, this);
    }
}
